(1, 'Staff Salaries and Benefits', 'This expense head includes the salaries, wages, and benefits paid to audiologists, speech-language pathologists, support staff, and other employees working in the clinic.'),
(2, 'Diagnostic Equipment', 'Expenses related to the purchase, maintenance, and calibration of diagnostic equipment used for hearing and speech assessments, such as audiometers, tympanometers, speech perception tools, and software.'),
(3, 'Rent or Lease', 'Expenses associated with renting or leasing the clinic space where the services are provided, including monthly rental payments or lease agreements'),
(4, 'Training and Education', 'Expenses for training programs, workshops, seminars, and continuing education for hospital staff to enhance their skills and knowledge.'),
(5, 'Office Supplies and Consumables', 'Expenses for office supplies, stationery, printing materials, and other consumables used in the administrative and clinical operations of the clinic.'),
(6, 'Therapy Materials and Resources', 'Costs for acquiring and maintaining therapy materials, such as speech therapy software, workbooks, assessment tools, speech-language evaluation materials, and therapy supplies'),
(7, 'Marketing and Advertising', 'Expenditures related to marketing initiatives, website development, online advertising, printed materials, and promotional activities to attract clients and promote the clinic\'s services'),
(8, 'Maintenance and Repairs', 'Costs for maintaining and repairing clinic equipment, furniture, fixtures, and facilities to ensure proper functioning and a conducive environment for clients.'),
(9, 'Telecommunication Expenses', 'Costs for telephone systems, internet services, video conferencing tools, and other communication technologies used for virtual consultations or telepractice services.'),
(10, 'Professional Memberships and Licensing Fees', 'Payments for professional memberships in relevant associations, licensing fees, and certifications required for audiologists and speech-language pathologists.');

