(7, 'copyright_text', 'copyright@3sdsolutions | 2023'),
(8, 'slider', '[{\"title\":\"Your Hearing, Our Passion\",\"description\":\"As pioneers in the field of audiology, we are dedicated to pushing the boundaries of innovation and revolutionizing hearing healthcare.\",\"image\":\"slider1.jpg\"},{\"title\":\"Experience Unparalleled Hearing Care\",\"description\":\"Step into a world of cutting-edge audiology care, where our skilled experts provide personalized solutions for all your hearing needs.\",\"image\":\"slider2.jpg\"},{\"title\":\"Where Hearing Care Meets Exceptional Service\",\"description\":\"Experience a new standard of audiology care where professionalism and patient satisfaction are paramount.\",\"image\":\"slider3.jpg\"}]'),
(9, 'homepage_welcome_section', '[{\"title\":\"Welcome To Orange Wheels\",\"description\":\"Welcome to Orange Wheels Clinic, where your health and well-being are our top priorities. We are delighted to have you visit our website and explore the comprehensive healthcare services we offer.\\r\\n\\r\\nAt Orange Wheels Clinic, we value the importance of communication and patient education. We aim to empower our patients by providing them with the knowledge and information they need to make informed decisions about their health. Our team will guide you through your diagnosis, treatment options, and any necessary lifestyle changes, ensuring that you are an active participant in your healthcare journey.\",\"image\":\"welcome.png\"}]'),
(10, 'service_section', '[{\"title\":\"Our World Class Services\",\"description\":\"we provided services which are not directly  related to patient care but ,indirectly contribute in patient management.\"}]'),
(11, 'about_us', 'Welcome to <b>Orange Wheels</b> Audiology Clinic, where your hearing health and well-being are our top priorities. We are thrilled to have you visit our website and discover the comprehensive audiology services we offer.\r\n<br>\r\nAt Orange Wheels, we believe in delivering exceptional hearing care with a personalized approach. Our team of dedicated audiology professionals is committed to providing the highest standard of treatment and ensuring your comfort throughout your journey with us. Equipped with state-of-the-art facilities and cutting-edge technology, we strive to offer accurate assessments, effective treatments, and optimal outcomes for our patients.\r\n<br>\r\nWhether you require preventive care, diagnostic evaluations, or specialized treatments, our experienced audiologists and staff are here to guide you every step of the way. We understand that each individual\'s hearing needs are unique, and we tailor our approach to meet your specific requirements. Our compassionate team takes the time to listen to your concerns, answer your questions, and develop customized treatment plans that align with your goals and preferences.\r\n<br>\r\nYour hearing health and satisfaction are at the core of everything we do. We invite you to explore our website to learn more about our services, meet our team of experts, and access valuable resources for your hearing well-being. If you have any questions or would like to schedule an appointment, please don\'t hesitate to contact us. We look forward to welcoming you to Orange Wheels Audiology Clinic and being your trusted partner in your journey towards optimal hearing health.\r\n<br>\r\nThank you for considering Orange Wheels Audiology Clinic for your hearing needs. We are here to provide exceptional care and support you on your path to better hearing.'),
(12, 'recaptcha', '[{\"site_key\":\"6LePbzgUAAAAA\",\"secret_key\":\"6LePbzgUAAAAADb\"}]');

